import style from "./Select.module.css";

function Select(props) {
  const className = props.className
    ? `${style.select} ${props.className}`
    : `${style.select}`;

  return (
    <select onChange={props.onChange} className={className}>
      {props.children}
    </select>
  );
}

export default Select;
